import PreviousMap from 'postcss/lib/previous-map'
import React from 'react'
import Candidate from '../img/candidates/img.png'

const Candid = ({name, imgUrl}) => {
  return (
    <div>
        <img src={Candidate}></img>
        <div className='title'>{PreviousMap.name}</div>
    </div>
  )
}

export default Candid
